import React from 'react';
import './style.css'
import Profile from '../Profile'

class Sidebar extends React.Component {
  render = () => {
    return (
      <div className='sidebar'>
        <Profile/>
        <a href='#'>About </a>
      </div>
    )
  }

}

export default Sidebar;
